        }
        public void Run(int charWidth, int charHeight, int charLength)
        {
            Dictionary<int,int> Part1 = new Dictionary<int,int>();
            int size = charWidth * charLength * charHeight;
            var Layers = Enumerable.Range(0, Data.Length / size).Select(i => Data.Substring(i * size, size));
            int[] Part2 = Enumerable.Repeat(-1, size).ToArray();
            foreach (var layer in Layers)
            {
                Part1[layer.Count(lc => lc == '0')] = layer.Count(lc => lc == '1') * layer.Count(lc => lc == '2');
                for (int j = 0; j < size; j++)
                {
                    if ((layer[j] != '2') && (Part2[j] == -1))
                        Part2[j] = layer[j];
                }
            }
            Console.WriteLine("Part 1: " + (from b in Part1 orderby b.Key select b).First().Value);
            Console.WriteLine("Part 2: " +
                returnCharacter(Part2, 0, charWidth * charLength, '1') +
                returnCharacter(Part2, 1, charWidth * charLength, '1') +
                returnCharacter(Part2, 2, charWidth * charLength, '1') +
                returnCharacter(Part2, 3, charWidth * charLength, '1') +
                returnCharacter(Part2, 4, charWidth * charLength, '1'));
        }

        public char returnCharacter(int[] Input, int offset, int fullWidth, int qualifyingNumber)
        {
            string Count3 = ((Input[(0 * fullWidth) + 0 + (offset * 5)] == qualifyingNumber) ? "1" : "0") +
                ((Input[(2 * fullWidth) + 3 + (offset * 5)] == qualifyingNumber) ? "1" : "0") +
                ((Input[(5 * fullWidth) + 3 + (offset * 5)] == qualifyingNumber) ? "1" : "0");
                //((Input[(5 * fullWidth) + 3 + (offset * 5)] == qualifyingNumber) ? "1" : "0");
            string Count4 = ((Input[(3 * fullWidth) + 1 + (offset * 5)] == qualifyingNumber) ? "1" : "0");
            int count = 0;
            for (int i = 0; i < 6; i++)//hard coded height
            {
                for (int j = 0; j < 5; j++)//hard coded width
                {
                    count += (Input[(i * fullWidth) + j+(offset*5)] == qualifyingNumber) ? 1 : 0;
                }
            }
            switch (Count3)
            {
                case "000":
                    return 'C';
                case "001":
                    return 'G';
                case "010":
                    if (count==9) return 'J';
                    return 'O';
                case "011":
                    return 'A';
                case "100":
                    if (count == 15) return 'B';
                    if (count == 11) return 'F';
                    break;
                case "101":
                    if (count == 9) return 'L';
                    if (count == 14) return 'E';
                    if (Count4 == "0") return 'K';
                    return 'Z';
                case "110":
                    if (count == 9) return 'Y';
                    if (count == 14) return 'D';
                    if (Count4 == "1") return 'P';
                    return 'U';
                case "111":
                    if (Count4=="0") return 'H';
                    return 'R';
            }
            return ' ';
        }
